css:
.git-plus .error {
  color: #ff982d;
}
.git-plus .success {
  color: #2BDA77;
}
.git-plus .atom-panel.modal.from-bottom {
  width: 600px;
}
.git-plus.info-view {
  overflow: auto;
  max-height: 30vh;
}
.git-plus.info-view .output {
  background-color: inherit;
}
.select-list-buttons {
  margin-top: 5px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
atom-text-editor .syntax--diff .syntax--unimportant,
atom-text-editor.editor .syntax--diff .syntax--unimportant {
  color: #494d57;
}
atom-text-editor .syntax--diff .syntax--info,
atom-text-editor.editor .syntax--diff .syntax--info {
  color: #e0c285;
}
atom-text-editor .syntax--diff .syntax--deletion,
atom-text-editor.editor .syntax--diff .syntax--deletion {
  color: #e05252;
}
atom-text-editor .syntax--diff .syntax--insertion,
atom-text-editor.editor .syntax--diff .syntax--insertion {
  color: #43d08a;
}
atom-text-editor .syntax--diff .syntax--markup.syntax--removed.syntax--diff,
atom-text-editor.editor .syntax--diff .syntax--markup.syntax--removed.syntax--diff,
atom-text-editor .syntax--diff .syntax--meta.syntax--diff.syntax--header.syntax--from-file,
atom-text-editor.editor .syntax--diff .syntax--meta.syntax--diff.syntax--header.syntax--from-file {
  border-bottom: 2px solid #e05252;
}
atom-text-editor .syntax--diff .syntax--markup.syntax--added.syntax--diff,
atom-text-editor.editor .syntax--diff .syntax--markup.syntax--added.syntax--diff,
atom-text-editor .syntax--diff .syntax--meta.syntax--diff.syntax--header.syntax--to-file,
atom-text-editor.editor .syntax--diff .syntax--meta.syntax--diff.syntax--header.syntax--to-file {
  border-bottom: 2px solid #43d08a;
}
.git-plus-log {
  background-color: #292c2f;
  overflow-y: auto;
}
.git-plus-log #git-plus-commits {
  width: 100%;
  color: #aaa;
  cursor: pointer;
}
.git-plus-log #git-plus-commits td {
  padding: 8px 10px;
  border-bottom: 1px solid #000;
  vertical-align: top;
}
.git-plus-log #git-plus-commits .author {
  width: 30%;
}
.git-plus-log #git-plus-commits .date {
  width: 25%;
}
.git-plus-log #git-plus-commits .message {
  width: 50%;
}
.git-plus-log #git-plus-commits .hashShort {
  width: 10%;
  text-align: right;
}
.git-plus-log .show-more {
  text-align: center;
}
.git-plus-log #show-more {
  padding-top: 10px;
}
.status-bar .git-branch {
  cursor: pointer;
}
.status-bar .git-branch:hover {
  color: #fff;
}
